	Home,
	Promotions,
	Promotion,
	Login,
	Game,
	Profile,

	Inbox,

	About,

	Collection,
	Feedback,
	TransactionRecord,
	Referral,
	SpeedApp,
	JoinUs,
	
	DepositHistory,
	PromoHistory,
	TransferRecord,
	RebateHistory,
	DepositMethod,
	WithdrawalHistory,
	News,
	Vip,
	VipDetails
};
